  \"nesdis-viirs-polar-winds\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\":
  \"This dataset contains the Level 3 Polar Winds Northern and Southern Hemisphere
  datasets. The Level 3 Polar Winds data from VIIRS for the Arctic and Antarctic from
  65 degrees latitude poleward. Tropospheric winds are measured by tracking the motion
  of cloud features in the overlapping region of three successive orbits. A triplet
  of images is used to facilitate consistency checking and quality control. Wind products
  include wind speed, direction, and height at high latitudes. The products are distributed
  in netCDF-4 file format with metadata attributes included.\",\n\t\"license_title\":
